import Box from "@mui/material/Box";
import Button from "@mui/material/Button";
import RUhorizontal from "../assets/ipo_horizontal.png";
import React, { useState } from "react";
import HeaderImage from "../assets/header-img.jpg";
import {
  AppBar,
  Toolbar,
  Card,
  CardActionArea,
  CardContent,
  Grid,
  Typography,
  makeStyles,
} from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  appBar: {
    backgroundColor: "#cc0033 !important",
    color: "white",
  },
  RUhorizontal: {
    maxWidth: "35vw",
    padding: "10px",
  },
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
    textAlign: "center",
    fontWeight: 600,
  },
  paperTitle: {
    flexGrow: 1,
    textAlign: "center",
    position: "absolute",
    width: "100%",
    top: "30vh",
    left: "0px",
    color: "white",
    fontSize: "4vw",
  },
  card: {
    display: "inline",
  },
  cardInfo: {
    textAlign: "center",
    boxShadow: "0 6px 10px rgba(0,0,0,.08), 0 0 6px rgba(0,0,0,.05)",
    transition:
      ".3s transform cubic-bezier(.155,1.105,.295,1.12),.3s box-shadow,.3s -webkit-transform cubic-bezier(.155,1.105,.295,1.12)",
    margin: "10px",
    padding: "10px",
    "&:hover": {
      transform: "scale(1.05)",
      boxShadow: "0 10px 20px rgba(0,0,0,.12), 0 4px 8px rgba(0,0,0,.06)",
    },
  },
  cardActions: {
    justifyContent: "center",
  },
  superHeroImg: {
    width: "100%",
  },
}));

export default function HomeNavbar() {
  const classes = useStyles();

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar className={classes.appBar} position="static">
        <Toolbar disableGutters>
          <img
            src={RUhorizontal}
            className={classes.RUhorizontal}
            alt="RUhorizontal"
          />
          <Button
            // onClick={() => setIsOpen(!isOpen)}
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
            className={classes.loginBtn}
          >
            Login
          </Button>
        </Toolbar>
      </AppBar>

      <div className={classes.root}>
        <Grid container spacing={3}>
          <Grid item xs={12}>
            <Typography className={classes.paperTitle}>
              Welcome to the IP&O App
            </Typography>
            <img
              src={HeaderImage}
              className={classes.headerImg}
              alt="superHeroImage"
            />
          </Grid>
          <Grid item xs={6} className={classes.card}>
            <Card className={classes.cardInfo}>
              <CardActionArea>
                <CardContent className={classes.cardContent}>
                  <Typography gutterBottom variant="h5" component="h2">
                    Customer Form
                  </Typography>
                  <Typography
                    variant="body2"
                    color="textSecondary"
                    component="p"
                  >
                    Add your information to become a superhero!
                  </Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          </Grid>
          <Grid item xs={6} className={classes.card}>
            <Card className={classes.cardInfo}>
              <CardActionArea>
                <CardContent>
                  <Typography gutterBottom variant="h5" component="h2">
                    Hero Form
                  </Typography>
                  <Typography
                    variant="body2"
                    color="textSecondary"
                    component="p"
                  >
                    View hero squad details and select super heroes!
                  </Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          </Grid>
        </Grid>
      </div>
    </Box>
  );
}
